style.css:
@-moz-document domain("docs.google.com") {
/* Background color */
  body,
  .docs-titlebar,
  .kix-appview-editor,
  .kix-canvas,
  .docs-sheet-tab {
    background-color: #1E1E1E !important;
    color: #E0E0E0 !important;
  }

  /* Text color */
  .docs-titlebar-buttons,
  .docs-title-input,
  .kix-canvas-text-content,
  .kix-page {
    color: #E0E0E0 !important;
  }

  /* Links and highlights */
  a,
  .docs-sheet-tab:hover,
  .docs-sheet-tab-active {
    color: #007ACC !important;
  }

  /* Positive indicators */
  .positive-value {
    color: #00E676 !important;
  }

  /* Negative indicators */
  .negative-value {
    color: #FF5252 !important;
  }

  /* Borders and dividers */
  .docs-sheet-tab {
    border-color: #3C3C3C !important;
  }

  /* Menu and dialog backgrounds */
  .goog-menu,
  .docs-material-button,
  .docs-titlebar-menu {
    background-color: #2E2E2E !important;
  }

  /* Menu and dialog text */
  .goog-menuitem-content,
  .docs-material-button,
  .docs-titlebar-menu,
  .goog-menuitem {
    color: #E0E0E0 !important;
  }

  /* Highlighted menu item background */
  .goog-menuitem-highlight,
  .docs-material-button:hover,
  .docs-titlebar-menu:hover,
  .goog-menuitem-highlight .goog-menuitem-content {
    background-color: #3C3C3C !important;
  }
}
